import React from "react";
import NetflixLogo from "../components/NetflixLogo";

const GetStarted = () => {
  return (
    <div>
      <nav>
        <NetflixLogo />
        <div className="lang-signin"></div>
      </nav>
    </div>
  );
};

export default GetStarted;
